  false,\n\t\"url\": null,\n\t\"notes\": \"The Submarine Ring of Fire 2012 cruise
  will use the University of Bremen Quest 4000 remotely operated vehicle to locate,
  map and sample hydrothermal sites at seamounts and spreading centers in the Lau
  Basin. The sites were discovered by water column surveys, camera tows and prior
  dives with a remotely operated vehicle during cruises funded by NOAA, NSF and Nautilus
  Minerals Inc. in the past 8 years. They range in depth from ~750 to ~2600 m. We
  expect to visit 10 to 13 sites during the cruise. When the ROV is not in the water
  we will conduct other operations including multibeam surveys (with concurrent towed
  magnetometer, gravimeter, ADCP, and HDSS), CTD vertical and towed hydrocasts generally
  at locations close to the planned targets.\",\n\t\"license_title\": null,\n\t\"extras\":
